// Scala 
case class JaxbReplyTransformer[T](category: Class[T], setting: JAXBContext)
                                  (implicit m: Manifest[T]) extends ReplyTransformer[T] {
  def transform(body: String) = {
    val xml = XML.loadString(body)
    val jaxb = new JAXBIntrospector(setting)
    val obj = jaxb.getValue(xml)
    obj.asInstanceOf[T]
  }

  this.setting = setting;
}

// Scala
class JaxbReplyTransformer[T >: Null : Manifest](setting: JAXBContext)
  extends ReplyTransformer {
  def unmarshal(reply: String): T = {
    val unmarshaller = setting.createUnmarshaller
    unmarshaller.unmarshal(new StreamSource(new StringReader(reply)), manifest[T].erasure).getValue.asInstanceOf[T]
  }

